import heapq
from itertools import islice
def agen(): # generator of terms
    c = 12
    h = [(c, 1, 2)]
    nextcount = 3
    while True:
        (v, s, l) = heapq.heappop(h)
        yield s
        if v >= c:
            c = int(str(c) + str(nextcount))
            heapq.heappush(h, (c, 1, nextcount))
            nextcount += 1
        l += 1; v = int(str(v)[len(str(s)):] + str(l)); s += 1
        heapq.heappush(h, (v, s, l))
